import React, { Component } from "react";
import { Route, Switch } from "react-router-dom";

export default class Layout extends Component {
  render() {
    return (
      <React.Fragment>
        <Switch>
          <Route path="/test" render={() => { return (<p>test_01</p>);}}></Route>
        </Switch>
        <p>Test</p>
      </React.Fragment>
    );
  }
}
